import axios from "axios";
import { useEffect, useState } from "react";

const EmpList = () => {

    const [empList, setEmpList] = useState([]);

    useEffect(() => {
        console.log('useEffect');
        axios.get('http://localhost:8080/allemp')
            .then((resp) => {
                console.log(resp.data);
                setEmpList(resp.data);
            })
    }, []);

    const handleDelete = async (eid) => {
        try {
            console.log(eid);
            await axios.delete(`http://localhost:8080/delete/${employeeId}`);
            setEmpList(empList.filter(emp => emp.eid !== eid));
        } catch(error) {
            console.error('Error', error);
            throw new Error(error);
        }
    };

    return (
        <>
            <div style={{display: "flex", justifyContent: "center", alignItems: "center", marginTop: "50px"}}>
                <div class="card" style={{ width: "50rem" }}>
                    <div class="card-header" style={{ fontSize: '26px' }}>
                        <strong>Employee List</strong>
                    </div>
                    <table class="table">
                        <thead>
                            <tr>
                                <th scope="col">Name</th>
                                <th scope="col">Salary</th>
                                <th scope="col">Gmail</th>
                                <th scope="col">Delete</th>
                            </tr>
                        </thead>
                        <tbody>
                            {empList.map(emp =>
                                <tr key={emp.eid}>
                                    <td>{emp.firstName}</td>
                                    <td>{emp.salary}</td>
                                    <td>{emp.gmail}</td>
                                    <td>
                                        <button type="button" className="btn btn-outline-danger" onClick={() => handleDelete(emp.eid)}>Delete</button>
                                    </td>
                                </tr>
                            )}
                        </tbody>
                    </table>
                </div>
            </div>
        </>
    );
};

export default EmpList;



